import React from 'react'
import s from './window.module.css'
import Header from './Header/Header';
import Content from './Content/Content';
import Icon from '../../Images/Calculator.png'

const Window = (props) => {

    let ContentComponent = <div className={ s.ContentComponent }>хуета</div>

    return (
        <div className={s.Window} style={{ width: props.width, hieght: "99%" }}>
            <Header WindowName={props.WindowName} MainButtons={props.MainButtons} WindowIcon={props.WindowIcon} className={s.Header}/>
            <Content Text={props.Text} ContentComponent = { ContentComponent } className={s.Content}/>
        </div>
    );
}


export default Window;
